This is my toolbox, current options:

`AKey Loader` - `Nk3y`:`V"string"` - loads or unloads the first available key with that value, if available
cubit33.toolbox {k3y:"4jixaw"}

`AMarket Sort` - market:true, name:"string", key:"key" (the referenced key must be a number) - items are Sorted by the key:value
/mrkt = cubit33.toolbox {market:true, name:"k3y_v2", key:"k3y"}

`ATransactions` - transactions:true to see a handy display of all your transactions
/txs = cubit33.toolbox {{transactions:{0}}}

`ASafescript` - safescript:#s.user.script to check a user script and run it if it is fullsec. Include safescript_level:3 to run high sec scripts. a:[argument:value,argument2:"string"] to pass along arguments for the script (no spaces)
macro:
/safe = cubit33.toolbox {{ safescript:#s.{0} }}

`ATransfer k3ys` - a quick way to transfer all your keys to another user
/xferk3ys = {{ k3ysxfer:#s.sys.xfer_upgrade_to, to:"{0}" }}
